import { describe, it, expect } from 'vitest'
import {
  getBase64ImageMimeType,
  validateBase64Image,
} from './base64-image-validator'
import { faker } from '@faker-js/faker'

describe('Base64ImageValidator Tests', () => {
  it('should validate a base64 image', () => {
    const validBase64Image =
      'data:image/webp;base64,'

    const isBase64ImageValid = validateBase64Image(validBase64Image)

    expect(isBase64ImageValid).toBe(true)
  })

  it('should return false if a random string is encoded in base64', () => {
    const invalidBase64 = Buffer.from(
      faker.lorem.paragraph(),
      'base64'
    ).toString()

    const isBase64ImageValid = validateBase64Image(invalidBase64)
    expect(isBase64ImageValid).toBe(false)
  })

  it('Should return false if base64 has an invalid MIME Type (GIF)', () => {
    const invalidBase64Image =
      'data:image/gif;base64,'

    const isBase64ImageValid = validateBase64Image(invalidBase64Image)

    expect(isBase64ImageValid).toBe(false)
  })

  it('should return false if the base64 has invalid encoding padding', () => {
    const invalidBase64Image =
      'data:image/webp;base64,'

    const isBase64ImageValid = validateBase64Image(invalidBase64Image)

    expect(isBase64ImageValid).toBe(false)
  })
})

describe('getBase64ImageMimeType', () => {
  it('should return the correct image mime type', () => {
    const validBase64Image =
      'data:image/webp;base64,'

    const mimeType = getBase64ImageMimeType(validBase64Image)

    expect(mimeType).toBe('image/webp')
  })
})
